return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'da_DK','pot-creation-date'=>'2025-09-04 10:02-0500','po-revision-date'=>'2025-09-04 10:02-0500','translation-revision-date'=>'2025-09-04 10:02-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sDu kører ICS Calendar i en WordPress Playground-implementering%2$s Da ICS Calendar er beregnet til at køre på en webserver, kan nogle funktioner være utilgængelige eller ikke fungere korrekt.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sDin websted bruger i øjeblikket en UTC-offsetbaseret tidszone.%2$s Dette kan give fejl i tidsvisningen i %3$s-pluginprogrammet på steder, hvor sommertid overholdes. Du bedes %4$sændre din tidszoneindstilling%5$s til den by, der ligger nærmest din placering, i samme tidszone, for at få korrekt tidsvisning. Se vores %6$sdokumentation%7$s for yderligere oplysninger om dette problem.','Utilities'=>'Drift','Settings'=>'Indstillinger','User Guide'=>'Brugervejledning','Support'=>'Support','Upgrade to PRO!'=>'Opgrader til PRO!','Show/hide all'=>'Vis/skjul alle','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS-filen kunne ikke hentes eller var tom. Kontroll