ode.'=>'Ejendommen "url" i din %1$s shortcode ser ud til at indeholde HTML-tags; sandsynligvis er din URL-adresse blevet omdannet til et klikbart link. Din kalender vises muligvis ikke korrekt som følge heraf. Fjern venligst det klikbare link i genvejskoden.','The r34ics_url_get_contents() function is no longer supported.'=>'Funktionen r34ics_url_get_contents() er ikke længere understøttet.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sBemærk venligst:%2$s %3$s version 10.6 ændrer standardindstillingerne for flere shortcode-indstillinger. For at bevare konsistensen er disse nye standardindstillinger %4$sikke%5$s aktiveret, når du opgraderer fra en tidligere version. Hvis du vil vide mere om ændringerne, kan du læse vores %6$sblogindlæg%7$s, eller hvis du vil skifte til de nye standardindstillinger, skal du aktivere %8$sindstillingen på %9$sindstillinger%10$ssiden.','Use new parameter defaults (v.10.6)'=>'Brug nye standardindstillinger for parametre (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sBemærk venligst:%2$s %3$s version 11.0 strømliner den måde, ICS-feed-URL\'er hentes på. Denne ændring bruger en standard indbygget WordPress-funktion, så den burde være fuldt kompatibel med alle eksisterende installationer. Hvis du støder på nye problemer efter at have opgraderet til version 11 eller senere, bedes du besøge %4$sWordPress Support Forums%5$s for at få hjælp.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sBemærk:%2$s %3$s version 11.5.14.2 introducerer en ny, mere sikker metode til håndtering af kalenderparametre ved indlæsning via AJAX. Fjern venligst alle caching-plugins, du bruger, for at sikre, at dine kalendere indlæses korrekt med den nye metode.','Add %1$s'=>'Tilføj %1$s','Close'=>'Luk','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Sørg for, at du bruger en %1$ssubscribe%2$s URL og ikke en %3$sweb view%4$s URL.%5$s (Hvis du indtaster URL\'en direkte i din webbrowser, skal du downloade en %6$s fil.)','Calendar Title:'=>'Kalendertitel:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Lad den være tom for at bruge kalenderens standardtitel. Indtast %1$s for at udelade titlen helt.','Calendar Description:'=>'Kalenderbeskrivelse:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Lad den være tom for at bruge kalenderens standardbeskrivelse. Indtast %1$s for at udelade beskrivelsen helt.','View:'=>'Vis:','month'=>'måned','list'=>'liste','week'=>'uge','Count:'=>'Antal:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Lad %1$s stå tomt for at medtage alle kommende begivenheder. %2$s skal være en standard %3$sPHP-datastreng%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Vis hændelsesbeskrivelser %1$s(ændre til et tal i den indsatte shortcode for at indstille ordgrænsen)%2$s','Show event locations %1$s(if available)%2$s'=>'Vis hændelsessteder %1$s(hvis tilgængelig)%2$s','Show event organizers %1$s(if available)%2$s'=>'Vis arrangører af begivenheder %1$s(hvis tilgængelig)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sBemærk:%2$s Yderligere %3$svisningsmuligheder%4$s er tilgængelige ved at redigere shortkoden manuelt efter indsættelse.','Insert %1$s'=>'Indsæt %1$s','Do even more with %1$s!'=>'Gør endnu mere med %1$s!','Calendar Builder'=>'Kalendergenerator','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurer alle kalenderindstillinger med en nem visuel grænseflade ... ingen grund til manuelt at skrive kortkoder.','Additional Views and Enhanced Features'=>'Yderligere visninger og forbedrede funktioner','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nye måder at vise din kalender på, herunder Fuld, Næste, Murværk, Måned med sidebjælke, Widget og meget mere. Der er tilføjet yderligere funktioner til kernevisningerne Month, Basic, List og Week.','Customizer'=>'Tilpasning','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Du kan nemt ændre din kalenders farvepaletter, skrifttyper og meget mere på hele websitet.','ICS Events'=>'ICS-begivenheder','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNyt!%2$s Gør %3$s til et komplet kalendersystem. Opret og administrer begivenheder direkte i WordPress, og integrer dem endda problemfrit med dine eksisterende feeds.','Visit %1$s to learn more.'=>'Besøg %1$s for at få mere at vide.','Go PRO!'=>'Skift til Pro!','Getting Started'=>'Kom godt i gang','System Report'=>'Systemrapport','Save Changes'=>'Gem ændringer','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Tak for installationen %1$s. Før du opretter din første kalendergenvejskode, skal du besøge din %2$sGenerelle indstillinger%3$s side og kontrollere, at indstillingerne for sprog, tidszone og dato/tidsformat er korrekte på dit websted. Se vores %4$sBrugervejledning%5$s for flere oplysninger.','Quick Start Guide'=>'Hurtig start guide','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Der findes en omfattende %1$sBrugervejledning%2$s på vores hjemmeside. Nedenfor er der nogle hurtige links til vigtige ressourcer i dokumentationen.','General:'=>'Generelt:','General WordPress Settings'=>'Generelle WordPress-indstillinger','%1$s Settings'=>'%1$s Indstillinger','Working with Shortcodes:'=>'Arbejde med kortkoder:','Shortcode Overview'=>'Oversigt over kortkoder','Shortcode Builder'=>'Shortcode Builder','Shortcode Parameters Reference'=>'Reference til kortkodeparametre','Advanced Topics:'=>'Avancerede emner:','FAQs and Tips'=>'Ofte stillede spørgsmål og tips','CSS Guide'=>'CSS-guide','Developer Resources'=>'Ressourcer til udviklere','GDPR'=>'GDPR','Appearance'=>'Udseende','Match calendar color palette to current Block Theme colors'=>'Match kalenderens farvepalet med de aktuelle Block Theme-farver','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Erstatter den neutrale %1$s-standardfarvepalet med de nærmeste match fra den aktuelle Site Editor Styles-farvepalet eller %2$s-filen i dit tema. Farvevalgene er algoritmiske, og nogle kombinationer består muligvis ikke kontrasttests for tilgængelighed. Denne indstilling har ingen effekt, hvis du bruger et "klassisk" tema, der ikke indeholder en %3$s-fil.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sDette er i øjeblikket en beta-funktion%2$s. Det kan kræve nogle justeringer af dine kalenderindstillinger eller CSS for optimal visning, især hvis du har farvekodet dine feeds. Funktionaliteten kan blive ændret.','Dark mode'=>'Mørk tilstand','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverterer farvepaletten (lyse farver på en mørk baggrund). %1$sBemærk:%2$s Mørk tilstand anvender også automatisk stilændringer svarende til kortkodeparametrene %3$s og %4$s, så du behøver ikke at inkludere dem i din kortkode.','Loading'=>'Indlæser','Always use AJAX to render calendars (recommended)'=>'Brug altid AJAX til at gengive kalendere (anbefales)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Når dette er markeret, vil alle kalendere blive gengivet via AJAX (asynkront efter at siden er indlæst). Dette er især nyttigt i forbindelse med andre caching-plugins, eller hvis dine kalendere indeholder et stort antal begivenheder. Normalt sendes kalenderdata direkte i HTML\'en ved den første sideindlæsning, medmindre AJAX er angivet i kortkoden.','Increase memory limit when rendering calendars'=>'Forøg hukommelsesgrænsen ved gengivelse af kalendere','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Hvis din kalender ikke kan indlæses med en "out of memory"-fejl, kan du prøve at øge hukommelsesgrænsen. Et minimum på 512 MB anbefales. %1$s Bemærkninger: 1) Nogle hostingudbydere tillader muligvis ikke, at applikationer tilsidesætter serverens standardindstilling. 2) Det er ikke muligt at indstille denne indstilling lavere end den aktuelle standardhukommelsesgrænse på din server.','deprecated'=>'forældet','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Hvis dit websted er holdt op med at hente feeds efter version 11-opdateringen, skal du slå denne indstilling til for at bruge den gamle anmodningsmetode. Denne funktion er forældet og vil blive fjernet i en opdatering i den nærmeste fremtid.','Default shortcode'=>'Standard-kortkode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Hvis dit websted vil indeholde et stort antal kalenderkortkoder, der er konfigureret på samme måde, kan du indtaste en standard "basis"-kortkode her med de parametre, der skal være de samme for alle kalendere. Individuelle kortkoder på webstedet kan derefter kun indeholde de parametre, der er unikke for den pågældende kalender, som f.eks: %1$s Alle parametre, der indgår i den enkelte shortcode, vil tilsidesætte det, der er angivet her.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Tillad adgang til disse værtsnavne, der løser til reserverede IP-adresser','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Hvis din kalenderserver er hostet på den samme fysiske server som din hjemmeside, er en del af det samme lokale netværk eller på anden måde bruger en %1$sreserveret IP-adresse%2$s, skal du indtaste dens værtsnavn her for at tillade adgang. For flere kalenderservere skal du indtaste et værtsnavn pr. linje. Se %3$sdokumentationen%4$s%5$s for flere oplysninger.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Indtast et værtsnavn pr. linje. Værtsnavne er det grundlæggende domænenavn, ikke en fuld URL. %1$s Du skal f.eks. indtaste %2$s, ikke %3$s.','Caching'=>'Caching','Transient (cache) expiration'=>'Midlertidig udløb (cache)','seconds'=>'sekunder','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Indstiller, hvor længe kalenderfeed-data skal cachelagres på serveren (WordPress transients), før de genindlæses. Standardværdien er 3600 (1 time).','Miscellaneous'=>'Diverse','Remove "Add ICS Calendar" button in Classic Editor'=>'Fjern knappen "Tilføj ICS-kalender" i Classic Editor','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Som standard tilføjer ICS Calendar en "Tilføj ICS-kalender"-knap til værktøjslinjen over WYSIWYG-editoren, når du bruger Classic Editor. Markér dette felt for at fjerne knappen. Har ingen effekt på sider, der bruger Block Editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s version 10.6 introducerede nye standardværdier for flere shortcodeparametre. Nye installationer bruger automatisk de nye standardværdier, men opgraderede installationer vil fortsat bruge de gamle standardværdier, medmindre dette felt er markeret. Læs mere om disse ændringer på %2$svores blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Vores komplette brugervejledning er tilgængelig med fuld oversættelse til snesevis af sprog på vores websted:','For assistance, please use our %1$ssupport request form%2$s.'=>'Hvis du har brug for hjælp, kan du bruge vores %1$sformular til anmodning om support%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Når du kontakter support, bedes du inkludere %1$sSystem Report%2$s fra denne side.','Spread the word!'=>'Spred budskabet!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Hvis du finder %1$s nyttig, kan du hjælpe med at støtte vores fortsatte vækst og udvikling med en %2$sfemstjernet anmeldelse%3$s. Vi takker dig!','%1$s Data Cache'=>'%1$s Data Cache','Clear Cached Calendar Data'=>'Ryd cachelagrede kalenderdata','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Dette rydder straks alle eksisterende cachelagrede kalenderdata (rydder transienter), hvilket tvinger WordPress til at genindlæse alle kalendere, næste gang de vises. Cachelagring genoptages derefter som før.','ICS Feed URL Tester'=>'Tester af URL-adresse til ICS-feed','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Hvis du er bekymret for, at plugin\'et ikke henter dit feed korrekt, kan du teste URL\'en her.','Enter feed URL...'=>'Angiv URL-adresse til feed...','Test URL'=>'Test URL-adresse','Results:'=>'Resultater:','%1$s received.'=>'%1$s modtaget.','This appears to be a valid ICS feed URL.'=>'Dette ser ud til at være en gyldig ICS-feed-URL.','This does not appear to be a valid ICS feed URL.'=>'Dette ser ikke ud til at være en gyldig ICS-feed-URL.','Could not retrieve data from the requested URL.'=>'Der kunne ikke hentes data fra den ønskede URL-adresse.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Der opstod en ukendt fejl under forsøg på at hente den ønskede URL-adresse.','Please copy the following text and include it in your message when emailing support.'=>'Kopier følgende tekst, og medtag den i din meddelelse, når du e-mailer support.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Du bedes også inkludere %1$s shortcode præcis som du har indtastet den på den pågældende side.','For your site security please do NOT post the System Report in the support forums.'=>'Af hensyn til sikkerheden på dit websted må du IKKE skrive systemrapporten i supportforaene.','No events found.'=>'Ingen begivenheder blev fundet.','Previous Page'=>'Forrige side','Next Page'=>'Næste side','All Day'=>'Hele dagen','Today'=>'I dag','No events.'=>'Ingen begivenheder.','No additional events this month.'=>'Ingen yderligere begivenheder i denne måned.','Last week'=>'Sidste uge','This week'=>'Denne uge','Next week'=>'Næste uge','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Gør din Google-kalender, Microsoft Office 365- eller Apple iCloud-kalender til en problemfrit integreret, automatisk opdateret WordPress-oplevelse, der ikke kræver vedligeholdelse.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
